CQ.docs.minitoc={};
CQ.docs.minitoc.clear=function(){if(typeof CQ.docs.minitoc.items!="undefined"){CQ.docs.minitoc.items.length=0
}else{CQ.docs.minitoc.items=[]
}};
CQ.docs.minitoc.storeitem=function(c,b){if(typeof CQ.docs.minitoc.items=="undefined"){CQ.docs.minitoc.clear()
}var a={property:c,value:b};
CQ.docs.minitoc.items.push(a)
};
CQ.docs.minitoc.additems=function(a){if(typeof CQ.docs.minitoc.items!="undefined"){for(var b=0;
b<CQ.docs.minitoc.items.length;
b++){var c=new CQ.Ext.form.NumberField({xtype:"numberfield",fieldLabel:CQ.docs.minitoc.items[b].property,name:"./"+CQ.docs.minitoc.items[b].property,width:"20",labelSeparator:": "});
c.setValue(CQ.docs.minitoc.items[b].value);
a.items.add(b,c)
}}};
CQ.docs.minitoc.validate=function(e){var b=e.findByType("numberfield");
var a=false;
for(var d=0;
d<b.length;
d++){if(b[d].value<0){continue
}for(var c=d+1;
c<b.length;
c++){if(b[c].value<0){continue
}if(b[d].value==b[c].value){a=true;
var f=b[c].value;
f++;
b[c].setValue(f);
d=-1;
c=b.length
}}}if(a){alert("Duplicate positive indexes were automatically corrected. Please review the order of the TOC items.");
e.update
}return true
};